    "Check the device after creation and edit it to correct role and states.": {"en": "Check the device after creation and edit it to correct role and states.", "de": "Überprüfen Sie das Gerät nach dem Anlegen und bearbeiten sie es, um den richtigen Typ und die Datenpunkte festzulgen.", "ru": "Проверьте устройство после создания и отредактируйте его, чтобы исправить роль и состояния.", "pt": "Verifique o dispositivo após a criação e edite-o para corrigir a função e os estados.", "nl": "Controleer het apparaat na het maken en bewerk het om de rol en statussen te corrigeren.", "fr": "Vérifiez le périphérique après sa création et modifiez-le pour corriger le rôle et les états.", "it": "Controllare il dispositivo dopo la creazione e modificarlo per correggere il ruolo e gli stati.", "es": "Verifique el dispositivo después de la creación y edítelo para corregir el rol y los estados.", "pl": "Sprawdź urządzenie po utworzeniu i edytuj je, aby poprawić rolę i stany.", "zh-cn": "创建后检查设备并对其进行编辑以更正角色和状态。"},
