    "Delete directory %s and all its content on server? Warning: This can't be undone!": {"en": "Delete directory %s and all its content on server? Warning: This can't be undone!", "de": "Das Verzeichnis %s und alle seine Inhalte auf dem server löschen? Warnung: Dies kann nicht rückgängig gemacht werden!", "ru": "Удалить каталог %S и все ее содержимое на сервер? Предупреждение: это не может быть отменено!", "pt": "Excluir o diretório %s e todo o seu conteúdo no servidor? Aviso: Isto não pode ser desfeita!", "nl": "Verwijderen van directory %s en alle inhoud op de server? Waarschuwing: Dit kan niet ongedaan worden gemaakt!", "fr": "Supprimer le répertoire %s et l'ensemble de son contenu sur le serveur? Avertissement: Ce ne peut pas être annulée!", "it": "Eliminare la directory %s e tutto il suo contenuto sul server? Attenzione: Questo non può essere annullata!", "es": "Eliminar el directorio %s y todo su contenido en el servidor? Advertencia: Esto no se puede deshacer!", "pl": "Usunąć katalog %S i całą jego zawartość na serwer? Uwaga: to nie może być anulowane!", "zh-cn": "警告：确认删除服务器上%s目录及其所有内容？此操作不可撤销！"},
