    "Devices have a role, that determines the function of the device, which icons are used and so on.": {"en": "Devices have a role, that determines the function of the device, which icons are used and so on.", "de": "Die Geräte haben jeweils einen Gerätetyp. Dieser bestimmt die Funktion des Gerätes und z.B. welche Icons verwendet werden.", "ru": "Устройства имеют определенную роль, что determines функцию устройства, какие значки используются и так далее.", "pt": "Dispositivos de ter uma função, que determines a função do dispositivo, que os ícones são usados e assim por diante.", "nl": "De apparaten hebben een rol, dat determines de functie van het apparaat, welke pictogrammen worden gebruikt en zo verder.", "fr": "Les appareils ont un rôle à jouer, que determines la fonction de l'appareil, les icônes qui sont utilisées, et ainsi de suite.", "it": "I dispositivi hanno un ruolo, che ne determina la funzione del dispositivo, che vengono utilizzate le icone e così via.", "es": "Los dispositivos tienen un papel, que determines la función del dispositivo, que se utilizan íconos y así sucesivamente.", "pl": "Urządzenia mają określoną rolę, że determines funkcji urządzenia, które ikony są używane, i tak dalej.", "zh-cn": "设备需要指定一个角色，不同的角色将决定设备的功能，图标等。"},
